import React from 'react';
import { useNavigate } from 'react-router-dom';

function Sidebar() {
    const navigate = useNavigate();

    const handleNavigation = (page) => {
        switch(page) {
            case 'home':
                navigate('/');
                break;
            case 'pet':
                navigate('/pet');
                break;
            case 'doc':
                navigate('/doc');
                break;
            case 'detect':
                navigate('/detect');
                break;
            case 'eventsChart':
                navigate('/eventsChart');
                break;
            case 'search':
                navigate('/search');
                break;
            case 'search':
                navigate('/api');
                break;
            default:
                navigate('/');
                break;
        }
    };

    return (
        <div className="sidebar">
            <ul>
                <li onClick={() => handleNavigation('home')}>Главная</li>
                <li onClick={() => handleNavigation('pet')}>Личный кабинет</li>
                <li onClick={() => handleNavigation('doc')}>Статьи</li>
                <li onClick={() => handleNavigation('detect')}>Детекция</li>
                <li onClick={() => handleNavigation('eventsChart')}>График</li>
                <li onClick={() => handleNavigation('search')}>Поиск</li>
                <li onClick={() => handleNavigation('api')}>API</li>
            </ul>
        </div>
    );
}

export default Sidebar;
